let movie = {
  Title: "The Incredible Hulk",
  Year: "2008",
  imdbID: "tt0800080",
  Type: "movie",
  Poster:
    "https://m.media-amazon.com/images/M/MV5BMTUyNzk3MjA1OF5BMl5BanBnXkFtZTcwMTE1Njg2MQ@@._V1_SX300.jpg",
};

function Show() {
  return (
    <div>
      <h3>Title : {movie.Title}</h3>
      <p>Year : {movie.Year} </p>
      <p>Type : {movie.Type} </p>
      <img src={movie.Poster} />
    </div>
  );
}
export default Show;
